import Tabs from './index.vue';
import TabsPane from './TabsPane.vue';
Tabs.install = (Vue) => {
    Vue.component(Tabs.name, Tabs);
};
TabsPane.install = (Vue) => {
    Vue.component(TabsPane.name, TabsPane);
};
export {
    Tabs,
    TabsPane,
};
export default {
    install(Vue) {
        Tabs.install(Vue);
        TabsPane.install(Vue);
    },
    Tabs,
    TabsPane,
};
